import { NavLink } from "react-router-dom";

const Botones = () => {

    const Estilos = {
        Main: 'flex justify-between sticky z-10 font-[system-ui]',
        Cambio: 'w-[50px] bg-[#1b6102] rounded-lg border-8 border-[#2da202] border-double my-1 font-[system-ui] font-semibold text-white mx-1',
        Div: 'flex justify-evenly content-end h-1/5 my-12',
        Button: 'bg-[#1b6102] rounded-lg border-8 border-[#2da202] border-double my-1 font-semibold text-5xl text-white',
    }

    return (
        <main className={Estilos.Main}>
            <button className={Estilos.Cambio}>P<br></br>R<br></br>E<br></br>V<br></br>I<br></br>O<br></br>U<br></br>S</button>
            <div className={Estilos.Div}>
                <button className={Estilos.Button}>
                <NavLink to="List">List View</NavLink>
                </button>
                <button className={Estilos.Button}>
                    <NavLink to="/">Details</NavLink>
                </button>
                <button className={Estilos.Button}>
                <NavLink to="/">Search</NavLink>
                </button>
                <button className={Estilos.Button}>
                <NavLink to="/">Close</NavLink>
                </button>
            </div>
            <button className={Estilos.Cambio}>N<br></br>E<br></br>X<br></br>T</button>
        </main>
    );
}

export default Botones;
